#include <stdio.h>
#include <string.h>

#define N 17
#define K 14

int n, k;
char s[N][K + 1];
int cnt[N][N];
int vis[N];
int ord[N];

void dfs(int u) {
    if (vis[u]) return;
    vis[u] = 1;
    for (int i = 0; i < n; i++) {
        if (cnt[u][i] == k - 1) {
            dfs(i);
            ord[u] = i;
        }
    }
}

int main() {
    scanf("%d %d", &n, &k);
    for (int i = 0; i < n; i++) {
        scanf("%s", s[i]);
        for (int j = 0; j < n; j++) {
            cnt[i][j] = 0;
            for (int l = 0; l < k; l++) {
                if (s[i][l] == 'A' + j) cnt[i][j]++;
            }
        }
    }
    for (int i = 0; i < n; i++) {
        if (!vis[i]) dfs(i);
    }
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            if (ord[j] > ord[i] && cnt[i][j] == k - 1) {
                printf("Invalid order\n");
                return 0;
            }
        }
    }
    for (int i = 0; i < n; i++) {
        printf("%c", 'A' + ord[i]);
    }
    printf("\n");
    return 0;
}
